    @staticmethod
    def plot(oFile=None):
        iris = GeoDataFrameDemosC.irisTastavin()
        buildings = GeoDataFrameDemosC.irisTastavinBuildings()
        roads = GeoDataFrameDemosC.irisTastavinRoads()
        streetlights = GeoDataFrameDemosC.irisTastavinStreetlights()
        trees = GeoDataFrameDemosC.irisTastavinTrees()

        # MAPPING
        minx, miny, maxx, maxy = iris.total_bounds

        fig, ax = plt.subplots(figsize=(1 * 8.26, 1 * 8.26))
        iris.boundary.plot(ax=ax, color="orange", linestyle=":", linewidth=5.5)
        buildings.plot(ax=ax, color="grey")
        roads.plot(ax=ax, color="black")
        streetlights.plot(ax=ax, color="red", marker="+")
        trees.plot(ax=ax, color="green", marker=".")
        ax.axis('off')
        ax.axis([minx, maxx, miny, maxy])
        plt.tight_layout()
        if oFile is None:
            plt.show()
        else:
            plt.savefig(oFile, bbox_inches="tight")
        plt.close(fig)

